const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header name={course}></Header>
      <Content part={part1} exercises={exercises1}></Content>
      <Content part={part2} exercises={exercises2}></Content>
      <Content part={part3} exercises={exercises3}></Content>
      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
      <Content exercise1 = {exercises1} exercise2 = {exercises2} exercise3 = {exercises3}></Content>
    </div>
  )
}
const Header = (props) => {
  return(
  <h1>{props.name}</h1>
  )
}
const Content = (props) => {
  return(
  <p>{props.part} {props.exercises}</p>
  )
}
const Total = (props) => {
  return(
  <p>Number of exercises {props.exercise1+props.exercise2+props.exercise3}</p>
  )
}
export default App
